<div class="homepage-services__services-list--service">
  <h1 class="homepage-services__services-list--service-number">01</h1>
  <div class="homepage-services__services-list--service-description">
    <h2>For fleet operators</h2>
    <h4>Don’t miss out on the chance to showcase your fleet on the most prominent real-time booking system in the charter industry.</h4>
    <p>Joining the <strong>NauSYS</strong> distribution network has <strong>proven beneficial</strong> for over <strong>900 fleets</strong>, enabling them to <strong>attract more bookings</strong> and <strong>enhance their market visibility</strong>. By becoming a part of the <strong>NauSYS</strong> network, <strong>your yachts will gain exposure to over 5,000 agencies worldwide</strong> and <strong>will be listed on over 250 websites</strong> <strong>via direct database connections, significantly expanding your potential for bookings.</strong><br><br>Choose from two options: the <strong>basic Distribution package </strong>or the <strong>Premium Partnership</strong>, which <strong>includes</strong> the comprehensive <strong>back office solution</strong>. <br><br></p><p>Both packages are <strong>user-friendly</strong> and <strong>designed to save you time </strong>while streamlining your operations. Whether you need a <strong>complete solution for invoicing and contract creation</strong> or simply want to <strong>oversee your booking plan,</strong> <strong>NauSYS</strong> is the efficient partner you can rely on. <strong>Accessible from any web browser</strong>, <strong>NauSYS</strong> allows you to manage your fleet from anywhere, at any time.</p><p></p>
  </div>
  <button class="homepage-services__services-list--service-button" type="button" fdprocessedid="x61mkk">
    <img decoding="async" data-src="https://www.nausys.com/wp-content/uploads/2023/07/arrow-blue.svg" class=" lazyloaded" src="https://www.nausys.com/wp-content/uploads/2023/07/arrow-blue.svg"><noscript><img decoding="async" src="https://www.nausys.com/wp-content/uploads/2023/07/arrow-blue.svg"/></noscript>
  </button>
  <span></span>
</div>

<div class="homepage-services__services-list--service">
  <h1 class="homepage-services__services-list--service-number">02</h1>
  <div class="homepage-services__services-list--service-description">
    <h2>For charter agencies</h2>
    <h4>If you are looking for available yachts worldwide – bareboat, skippered, or fully crewed, NauSYS is the perfect system for you.</h4>
    <p>By joining our <strong>FREE Agency portal</strong>, you <strong>gain access </strong>to over <strong>8,500 real-time available yachts from 900 fleets</strong>. With over 8,500 yachts as exclusive <strong>NauSYS</strong> partners, you can rest assured that you will find the most diverse and accurate offers.<br><br><strong>With just a few clicks, easily select multiple yachts, manage discounts, and add additional services. Most importantly, you have the ability to send direct offers to clients and book faster than ever before</strong>. <br><br><strong>And the best part? We charge 0% fees on all bookings!</strong></p>
  </div>
  <button class="homepage-services__services-list--service-button" type="button" fdprocessedid="7tll">
    <img decoding="async" data-src="https://www.nausys.com/wp-content/uploads/2023/07/arrow-blue-1.svg" class=" lazyloaded" src="https://www.nausys.com/wp-content/uploads/2023/07/arrow-blue-1.svg"><noscript><img decoding="async" src="https://www.nausys.com/wp-content/uploads/2023/07/arrow-blue-1.svg"/></noscript>
  </button>
  <span></span>
</div>

<div class="homepage-services__services-list--service">
  <h1 class="homepage-services__services-list--service-number">03</h1>
  <div class="homepage-services__services-list--service-description">
    <h2>For yacht owners</h2>
    <h4>Portal for owners to access data about their yacht availability and more, depending on the agreement with the managing company.</h4>
    <p>You can conveniently <strong>view and track the booking schedule</strong>, enabling you to plan your private vacation accordingly.<br><br>In addition to availability, the portal offers various features tailored to meet the specific needs of yacht owners. Depending on the agreement with the managing company, you may <strong>have access to information such as crew lists and yacht balance,</strong> as well as <strong>create reservations yourself</strong>.</p>
  </div>

  <h3 class="homepage-integrations__categories--title" style="--tooltip-width:211px">API data stream</h3>
  <div class="homepage-integrations__categories--description"><p><strong>Integrating the booking system with web pages</strong> is the prevailing method for efficient reservations, both for charter agencies and charter operators. <strong>Using the API implementation</strong>, guests can s<strong>earch for available yachts based on their criteria</strong> and <strong>easily book their favorite yacht all on their own</strong>.</p>
<p>&nbsp;</p>
<p>With the API, <strong>developers</strong> can effortlessly harness the power of <strong>NauSYS</strong> as a <strong>source for processed data.</strong></p>
<p>&nbsp;</p>
<p><strong>This versatility enables rapid adaptation of technologies, making your applications flexible for future upgrades.</strong> Also, due to its flexibility, <strong>it is up to you how to present data on your web, making it a fully customizable option.</strong></p></div>
</div>

  <h3 class="homepage-integrations__categories--title" style="--tooltip-width:211px">iFrame</h3>
  <div class="homepage-integrations__categories--description"><p><strong>The simplest way to enhance your website is with our user-friendly search tool.</strong></p>
<p>&nbsp;</p>
<p>With the <strong>predefined iFrame widget</strong>, your website visitors can <strong>easily search for available yachts based on criteria</strong>, such as destination, dates, and more. The widget<strong> taps into the large NauSYS database,</strong> which includes thousands of <strong>real-time available yachts from fleets worldwide</strong>.</p>
<p>&nbsp;</p>
<p><strong>By integrating the iFrame,</strong> you will offer visitors an intuitive yacht search experience. This not only keeps visitors engaged but also increases the chances of converting them into customers.</p>
<p>&nbsp;</p>
<p><strong>The best part is, that the integration is quick and straightforward!</strong></p></div>
</div>

  <h3 class="homepage-integrations__categories--title" style="--tooltip-width:211px">Backoffice</h3>
  <div class="homepage-integrations__categories--description"><p>The <strong>flexibility</strong> of the <strong>API</strong> ensures <strong>compatibility with a wide range of systems</strong>, allowing you to integrate with your existing infrastructure.</p>
<p><br>A popular integration option is with <strong>the back office software</strong>, which <strong>provides real-time updates on stock status and prices.</strong> These updates are then transmitted to your bookkeeping software, enabling the creation of invoices.</p>
<p>&nbsp;</p>
<p>For better automation we are <strong>already integrated with Ritam, E-računi,</strong> and <strong>Pantheon</strong>, eliminating manual data entry and ensuring accuracy.</p>
<p>&nbsp;</p>
<p>Additionally, you can connect with other systems, enabling data exchange with suppliers and third-party applications.</p></div>
